import React, { useState } from 'react';
import { Button, TextField, Box, Typography, Paper, Divider } from '@mui/material';
import { makeStyles } from '@mui/styles';y

// Define custom styles using MUI's makeStyles hook
const useStyles = makeStyles((theme) => ({
  root: {
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    padding: theme.spacing(4),
    backgroundColor: '#f5f5f5',
    minHeight: '100vh',
  },
  chatBox: {
    width: '100%',
    maxWidth: '600px',
    marginBottom: theme.spacing(3),
    padding: theme.spacing(2),
    backgroundColor: '#fff',
    borderRadius: '10px',
    boxShadow: '0 4px 12px rgba(0,0,0,0.1)',
    height: '70%',
    overflowY: 'auto',
  },
  chatMessage: {
    marginBottom: theme.spacing(2),
  },
  inputBox: {
    display: 'flex',
    alignItems: 'center',
    width: '100%',
    maxWidth: '600px',
    marginTop: theme.spacing(2),
  },
  inputField: {
    flex: 1,
    marginRight: theme.spacing(2),
  },
  button: {
    backgroundColor: '#4CAF50',
    color: '#fff',
    '&:hover': {
      backgroundColor: '#45a049',
    },
  },
  botMessage: {
    backgroundColor: '#e0f7fa',
    padding: theme.spacing(1),
    borderRadius: '10px',
    maxWidth: '80%',
    marginLeft: 'auto',
  },
  userMessage: {
    backgroundColor: '#c8e6c9',
    padding: theme.spacing(1),
    borderRadius: '10px',
    maxWidth: '80%',
    marginRight: 'auto',
  },
}));

function App() {
  const classes = useStyles();
  const [query, setQuery] = useState('');
  const [chat, setChat] = useState([]);

  const send = async () => {
    try {
      console.log('Sending:', query);

      const res = await fetch('http://localhost:8000/query', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({ text: query }),
      });

      const data = await res.json();
      console.log('Backend JSON:', data);

      // Safely get text if answer is object or string
      let botReply = '';

      if (typeof data.answer === 'string') {
        botReply = data.answer;
      } else if (typeof data.answer === 'object' && data.answer !== null) {
        // Try to extract text property
        if ('text' in data.answer) botReply = data.answer.text;
        else botReply = JSON.stringify(data.answer);
      } else {
        botReply = data.error ?? 'No valid response';
      }

      setChat([...chat, { user: query, bot: botReply }]);
    } catch (err) {
      console.error('Fetch error:', err);
      setChat([...chat, { user: query, bot: 'Network or server error' }]);
    }

    setQuery('');
  };

  return (
    <Box className={classes.root}>
      <Typography variant="h4" gutterBottom>
        AI LinkedIn Assistant (Demo)
      </Typography>

      <Paper className={classes.chatBox}>
        {chat.map((c, i) => (
          <div key={i} className={classes.chatMessage}>
            <div className={classes.userMessage}>
              <Typography variant="body1" color="textPrimary">
                <strong>You:</strong> {c.user}
              </Typography>
            </div>
            <Divider />
            <div className={classes.botMessage}>
              <Typography variant="body1" color="textSecondary">
                <strong>Coach:</strong> {c.bot}
              </Typography>
            </div>
          </div>
        ))}
      </Paper>

      <div className={classes.inputBox}>
        <TextField
          value={query}
          onChange={(e) => setQuery(e.target.value)}
          className={classes.inputField}
          variant="outlined"
          placeholder="Ask a question..."
        />
        <Button onClick={send} variant="contained" className={classes.button}>
          Send
        </Button>
      </div>
    </Box>
  );
}

export default App;
